import React from 'react';
import Footer from "./Components/Footer";
import Navbar from "./Components/Navbar";
import { ContextProvider } from './Components/utils/global.context';
import Home from './Routes/Home';



function App() {
  return (
    <ContextProvider>
      <div className="App">
          <Navbar/>
          <Footer/>
          <Home/>

      </div>
    </ContextProvider>
  );
}

export default App;
